function App() {
    var likes = 0;
    function Increment(){
      likes += 1
      console.log(likes);
    }

  return (
    <div className="App">
      <h1>{likes}</h1>
      <button
        onClick={() => likes += 1}
      >
        Increment
      </button>
      <button
        onClick={() => likes -= 1}
      >
        Decrement
      </button>
    </div>
  );
}

export default App;
